description:
- DT 4*11 nở hầu 4.1 DTCN = 45m2 cấp phép XD đủ;
- Hẻm 4.5m thông suốt, xe hơi vào tận nhà;
- Pháp lý : đất ở tại đô thị cấp XD 1 trệt 2 lầu không bị trừ lộ giới;
- Hiện trạng nhà : trệt lửng.
- Giá bán : 3tỷ 690 triệu TL.
- Nhà hẻm XE HƠI; trung tâm gò vấp; chiều ngang 4m ; KKHÔNG TIẾNG ỒN MÁY BAY; pháp lý là đất ở đô thị rõ ráng viiễn , giá chưa đến 4tỷ rất hiếm. Khách có nhu cầu nhanh chóng Liên hệ A Hùng - để xem nhà nhé

Bán gấp dãy trọ 10p Nguyễn Văn Quá, Đông Hưng Thuận, Quận 12, SHR, 135m2/935 triệu;
DT: 108m2(3*4);
Dãy trọ 10p, lối vào 1m, sạch sẽ, thoáng mát, có WC riêng từng phòng;
Nằm trong khu vực đông dân cư, gần Hội chữ thập đỏ Quận 12. Chợ, trường học, trạm y tế, bách hóa xanh... bán kính 800m;
Dãy trọ hiện đang cho thuê kín, giá thuê mỗi phòng:1,5 triệu/tháng;
Sổ hồng riêng, mua sang tên trong ngày;
Giá: 935 triệu (thương lượng);
Miễn tiếp cò, lái.
